        /// <summary>Returns a uint hash code of a Boolx4 vector.</summary>
        /// <param name="v">Vector value to hash.</param>
        /// <returns>uint hash of the argument.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static uint hash(Boolx4 v)
        {
            return csum(select(new U32x4(0x5FFF6B19u, 0x5E6CBF3Bu, 0xB546F2A5u, 0xBBCF63E7u), new U32x4(0xC53F4755u, 0x6985C229u, 0xE133B0B3u, 0xC3E0A3B9u), v));
        }

        /// <summary>
        /// Returns a U32x4 vector hash code of a Boolx4 vector.
        /// When multiple elements are to be hashes together, it can more efficient to calculate and combine wide hash
        /// that are only reduced to a narrow uint hash at the very end instead of at every step.
        /// </summary>
        /// <param name="v">Vector value to hash.</param>
        /// <returns>U32x4 hash of the argument.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static U32x4 hashwide(Boolx4 v)
        {
            return (select(new U32x4(0xFE31134Fu, 0x712A34D7u, 0x9D77A59Bu, 0x4942CA39u), new U32x4(0xB40EC62Du, 0x565ED63Fu, 0x93C30C2Bu, 0xDCAF0351u), v));
        }

        /// <summary>Returns the result of specified shuffling of the components from two Boolx4 vectors into a bool value.</summary>
        /// <param name="left">Boolx4 to use as the left argument of the shuffle operation.</param>
        /// <param name="right">Boolx4 to use as the right argument of the shuffle operation.</param>
        /// <param name="x">The ShuffleComponent to use when setting the resulting bool.</param>
        /// <returns>bool result of the shuffle operation.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static bool shuffle(Boolx4 left, Boolx4 right, ShuffleComponent x)
        {
            return select_shuffle_component(left, right, x);
        }

        /// <summary>Returns the result of specified shuffling of the components from two Boolx4 vectors into a Boolx2 vector.</summary>
        /// <param name="left">Boolx4 to use as the left argument of the shuffle operation.</param>
        /// <param name="right">Boolx4 to use as the right argument of the shuffle operation.</param>
        /// <param name="x">The ShuffleComponent to use when setting the resulting Boolx2 x component.</param>
        /// <param name="y">The ShuffleComponent to use when setting the resulting Boolx2 y component.</param>
        /// <returns>Boolx2 result of the shuffle operation.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static Boolx2 shuffle(Boolx4 left, Boolx4 right, ShuffleComponent x, ShuffleComponent y)
        {
            return new Boolx2(
                select_shuffle_component(left, right, x),
                select_shuffle_component(left, right, y));
        }

        /// <summary>Returns the result of specified shuffling of the components from two Boolx4 vectors into a Boolx3 vector.</summary>
        /// <param name="left">Boolx4 to use as the left argument of the shuffle operation.</param>
        /// <param name="right">Boolx4 to use as the right argument of the shuffle operation.</param>
        /// <param name="x">The ShuffleComponent to use when setting the resulting Boolx3 x component.</param>
        /// <param name="y">The ShuffleComponent to use when setting the resulting Boolx3 y component.</param>
        /// <param name="z">The ShuffleComponent to use when setting the resulting Boolx3 z component.</param>
        /// <returns>Boolx3 result of the shuffle operation.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static Boolx3 shuffle(Boolx4 left, Boolx4 right, ShuffleComponent x, ShuffleComponent y, ShuffleComponent z)
        {
            return new Boolx3(
                select_shuffle_component(left, right, x),
                select_shuffle_component(left, right, y),
                select_shuffle_component(left, right, z));
        }

        /// <summary>Returns the result of specified shuffling of the components from two Boolx4 vectors into a Boolx4 vector.</summary>
        /// <param name="left">Boolx4 to use as the left argument of the shuffle operation.</param>
        /// <param name="right">Boolx4 to use as the right argument of the shuffle operation.</param>
        /// <param name="x">The ShuffleComponent to use when setting the resulting Boolx4 x component.</param>
        /// <param name="y">The ShuffleComponent to use when setting the resulting Boolx4 y component.</param>
        /// <param name="z">The ShuffleComponent to use when setting the resulting Boolx4 z component.</param>
        /// <param name="w">The ShuffleComponent to use when setting the resulting Boolx4 w component.</param>
        /// <returns>Boolx4 result of the shuffle operation.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static Boolx4 shuffle(Boolx4 left, Boolx4 right, ShuffleComponent x, ShuffleComponent y, ShuffleComponent z, ShuffleComponent w)
        {
            return new Boolx4(
                select_shuffle_component(left, right, x),
                select_shuffle_component(left, right, y),
                select_shuffle_component(left, right, z),
                select_shuffle_component(left, right, w));
        }

        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        internal static bool select_shuffle_component(Boolx4 a, Boolx4 b, ShuffleComponent component)
        {
            switch(component)
            {
                case ShuffleComponent.LeftX:
                    return a.x;
                case ShuffleComponent.LeftY:
                    return a.y;
                case ShuffleComponent.LeftZ:
                    return a.z;
                case ShuffleComponent.LeftW:
                    return a.w;
                case ShuffleComponent.RightX:
                    return b.x;
                case ShuffleComponent.RightY:
                    return b.y;
                case ShuffleComponent.RightZ:
                    return b.z;
                case ShuffleComponent.RightW:
                    return b.w;
                default:
                    throw new System.ArgumentException("Invalid shuffle component: " + component);
            }
        }

    }
